import React from 'react'
import { Form, Icon, Input, Button, Checkbox, message } from 'antd';

const FormItem = Form.Item;



class Home extends React.Component{


    render(){
        return(
            <Form>
                <FormItem>
                    <Button>
                        Register Student
                    </Button>
                    <FormItem>
                    <Button>
                        Take Attendance
                    </Button>
                    <Button>
                    View Student
                    </Button>
                    </FormItem>
                </FormItem>
            </Form>

        )
    }
}

export default Home;
